private void mergeLocalToBuilder() {
  if (this.name != null) {
    builder.setName(this.name);
  }
  if (this.defaultUnit != null) {
    builder.setUnits(this.defaultUnit);
  }
  if (this.resourceTypes != null) {
    builder.setType(convertToProtoFormat(this.resourceTypes));
  }
}
